function renderPlans(faqData){
	$('#fragmentholder_book').empty();
	var fragment = $(templates).filter('#bookcontent').html();
	for(var key=0;key <20; key++ ){
    faqData[key].key = key;
		$('#fragmentholder_book').append(Mustache.render(fragment, faqData[key]));
	}
}
